import "./list.less";
import { errorCode, logout as _logout } from '@/api/wiki';
import { setToken } from '@/libs/util';
import ABackTop from '@/components/main/components/a-back-top';
export default {
  name: 'wiki_calculation',
  components: {
    ABackTop: ABackTop
  },
  created: function created() {
    var vm = this;
    errorCode().then(function (response) {
      vm.co = response.data.data.co;
    });
  },
  data: function data() {
    return {
      app_id: sessionStorage.getItem('ApiAdmin_AppInfo'),
      co: ''
    };
  },
  methods: {
    logout: function logout() {
      var vm = this;

      _logout().then(function (response) {
        vm.$Message.success(response.data.msg);
        setToken('');
        sessionStorage.removeItem('ApiAdmin_AppInfo');
        vm.$router.push({
          name: 'wiki_login'
        });
      });
    }
  }
};
